//       <a>{props.title}</a>
//     </Link>
//   </li>
// );

const Index = (props) => {
  return (
    <Layout>
      <h1>Batman TV Shows</h1>
      <ul>
        {props.shows.map(show => (
          <li key={show.id}>
            <Link href="/p/[id]" as={`/p/${show.id}`}>
              <a>{show.title}</a>
            </Link>
          </li>
        ))
        }
      </ul>
    </Layout>
  );
};

export default Index;
